import React from "react";
import styled from "styled-components";

const StarsBox = styled.div`
  width: 80px;
  display: flex;
  i {
    font-size: var(--font-size-small);
    color: var(--color-yellow);
  }
`;

const Stars = () => {
  return (
    <StarsBox>
      <i className="far fa-star"></i>
    </StarsBox>
  );
};

export default Stars;
